/* Reset & standardize default styles */
@import url("https://unpkg.com/@primo-app/primo@1.3.64/reset.css") layer;

/* Design tokens (apply to components) */
:root {
  /* Custom theme options */
  --color-accent: red;
  --font-primary: "Bespoke Serif", serif;
  --font-secondary: "Open Sans", sans-serif;

  /* Base values */
  --box-shadow: 0px 4px 30px rgba(0, 0, 0, 0.2);
  --border-radius: 8px;
  --border-color: blue;
}

/* Root element (use instead of `body`) */
#page {
  font-family: var(--font-secondary), system-ui, sans-serif;
  color: grey;
  line-height: 1.5;
  font-size: 1.125rem;
  background: black;
}

/* Elements */
.section-container {
  max-width: 900px;
  margin: 0 auto;
  padding: 4rem 2rem;
}

a.link {
  line-height: 1.25;
  font-weight: 400;
  border-bottom: 2px solid var(--color-accent, rebeccapurple);
  transform: translateY(-2px); /* move link back into place */
  transition: var(--transition, 0.1s border);

  &:hover {
    border-color: transparent;
  }
}

.heading {
  font-family: var(--font-primary);
  font-size: 2rem;
  line-height: 1.15;
  font-weight: 500;
  margin-bottom: 1.25rem;
}

.button {
  color: white;
  background: var(--color-accent, rebeccapurple);
  border-radius: 5px;
  padding: 8px 20px;
  transition: var(--transition, 0.1s box-shadow);
  border: 0; /* reset */

  &:hover {
    box-shadow: 0 0 0 2px var(--color-accent, rebeccapurple);
  }

  &.inverted {
    background: transparent;
    color: var(--color-accent, rebeccapurple);
  }
}

/* Content Section */
.section .content {
  max-width: 900px;
  margin: 0 auto;
  padding: 4rem 2rem;

  p {
    padding: 0.25rem 0;
  }

  img {
    width: 100%;
    margin: 2rem 0;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }

  a.link {
  }

  h1 {
    font-family: var(--font-primary);
    font-size: 3rem;
    font-weight: 500;
    margin-bottom: 1rem;
  }

  h2 {
    font-family: var(--font-primary);
    font-size: 2rem;
    font-weight: 500;
    margin-bottom: 1rem;
  }

  h3 {
    font-family: var(--font-primary);
    font-size: 1.5rem;
    font-weight: 500;
    margin-bottom: 0.5rem;
  }

  ul {
    list-style: disc;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  ol {
    list-style: decimal;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  blockquote {
    padding: 2rem;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }
}

section {
  position: relative;
}

select {
  border-bottom: 3px solid var(--color-accent);
  font-size: 1.125rem;
  padding-bottom: 0.5rem;
  margin-bottom: 2rem;
}

.tabs {
  display: none;
  margin-bottom: 3rem;
  font-size: 1.125rem;
  font-weight: 400;
  border-bottom: 1px solid var(--border-color);

  button:not(:last-child) {
    margin-right: 2rem;
  }

  button {
    padding-bottom: 0.75rem;
    border-bottom: 3px solid transparent;
    transition: 0.2s border-color;
    &.active {
      border-color: var(--color-accent);
    }
  }
}

.items {
  display: grid;
  gap: 3rem;
}

figure {
  img {
    border-radius: var(--border-radius);
    box-shadow: var(--box-shadow);
    margin-bottom: 1rem;
    aspect-ratio: 1.5;
    object-fit: cover;
  }

  figcaption {
    display: grid;
    gap: 0.25rem;
    span:first-child {
      font-weight: 500;
      font-size: 1.125rem;
    }
  }
}

#modal {
  position: fixed;
  inset: 0;
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 2rem;

  figure {
    width: 100%;
    max-width: 800px;
    position: relative;
    z-index: 1;

    img {
      width: 100%;
    }

    button {
      position: absolute;
      height: 2rem;
      width: 2rem;
      top: 0.5rem;
      left: 0.5rem;
      border-radius: 50%;
    }
  }

  .background {
    position: absolute;
    inset: 0;
    background: rgba(0, 0, 0, 0.8);
  }
}

@media (min-width: 400px) {
  select {
    display: none;
  }
  .tabs {
    display: inline-flex;
  }
  .items {
    grid-template-columns: 1fr 1fr;
    gap: 4rem;
  }
}

@media (min-width: 1200px) {
  .items {
    grid-template-columns: 1fr 1fr 1fr;
    gap: 6rem;
  }
}

